import React from 'react'

const Register = () => {
    return (
        <div className="container p-5">
            <div className="row">
                <div className="col-md-6 offset-md-3">
                    <h4>Register</h4>
                    <p>register form</p>
                </div>
            </div>
        </div>
    );
};

export default Register;
